import React, {useEffect} from 'react'
import {connect} from 'react-redux'
import {psignOut} from '../../actions'
const LogOut =()=>{
    useEffect(()=>{
        props.psignOut()
    })
    return (
        <div>
            Log Out
        </div>
    )
}

export default connect(null, {psignOut})(LogOut)
